import React from "react";

function Nav() {
    return (
        <nav className="h-20 w-screen bg-blue-300 flex justify-center shadow-lg">

            <div className="w-5/6 h-full border-2 border-solid border-gray-50">
                <ul>
                    <li>
                        <Link to="/" />
                    </li>
                </ul>
            </div>
        </nav>
    );
}

export default Nav;
